INSERT INTO `fooddetail` (`dfid`, `name`, `title`, `metric`, `description`, `image`, `note`) VALUES
(1, 'Fruits', 'Focus on whole fruits', 'cups', 'Focus on whole fruits that are fresh, frozen, canned, or dried.', 'images/fruits.png', '1 cup of fruits counts as</span><br />\r\n	 1 cup raw or cooked fruit; or<br />\r\n	 1/2 cup dried fruit; or<br />\r\n	 1 cup 100% fruit juice.\r\n\r\n'),
(2, 'Vegetables', 'Vary your veggies', 'cups', 'Choose a variety of colorful fresh, frozen, and canned vegetables . Make sure to include dark green, red, and orange choices', 'images/vegetables.png', '1 cup vegetables counts as</span><br />\r\n	 1 cup raw or cooked vegetables; or<br />\r\n	 	2 cups leafy salad greens; or<br />\r\n	 	1 cup 100% vegetable juice.'),
(3, 'Grains', 'Make half your grains whole grains', 'ounces', 'Find whole-grain foods by reading the Nutrition Facts label and ingredients list.', 'images/grains.png', '1 ounce of grains counts as</span><br />\r\n	1 slice bread; or<br />\r\n		1 ounce ready-to-eat cereal; or<br />\r\n	1/2 cup cooked rice, pasta, or cereal.<br />'),
(4, 'Protein', 'Vary your protein routine', 'ounces', 'Mix up your protein foods to include seafood, beans and peas, unsalted nuts and seeds, soy products, eggs, and lean meats and poultry.', 'images/protein.png', '1 ounce of protein counts as</span><br />\r\n	1 ounce lean meat, poultry, or seafood; or<br />\r\n	1 egg; or\r\n	1 Tbsp peanut butter; or<br />\r\n	1/4 cup cooked beans or peas; or<br />\r\n	1/2 ounce nuts or seeds.<br />'),
(5, 'Dairy', 'Move to low-fat or fat-free milk or yogurt', 'cups', 'Choose fat-free milk, yogurt, and soy beverages (soy milk) to cut back on your saturated fat.', 'images/diary.png', '1 cup of dairy counts as</span><br />\r\n	1 cup milk; or<br />\r\n	1 cup yogurt; or<br />\r\n	1 cup fortified soy beverage; or<br />\r\n	1 1/2 ounces natural cheese or 2 ounces processed cheese.');
